import React, { Component } from 'react';
//import Header from "./Header";

class Home extends Component {
  render() {
      return (
        <Router>
      <div>
        <ul>
          <li>
            <Link to="/">Form</Link>
          </li>
          <li>
            <Link to="/one">One</Link>
          </li>
          <li>
            <Link to="/two">Two</Link>
          </li>
        </ul>
        </div>
        </Router>
      )
  }
}


export default Home;
